import iconClosePath from './../images/close_icon.svg';
import React from 'react';

function PopupWithForm (props) {
    return (
        <div className={`popup popup_${props.name}`}>
            <div className="popup__container">
                <button type="button" className="popup__button-close">
                    <img className="popup__button-close-image" src={iconClosePath} alt="кнопка закрыть" />
                </button>
                <form className="popup__form popup__form_edit" name={props.name}>
                    <h2 className="popup__title">{props.title}</h2>
                    {props.children}
                    <button type="submit" className="popup__button-save">Сохранить</button>
                </form>
            </div>
        </div>
    )
}

export default PopupWithForm;
